import React from 'react';
import { Link } from 'react-router-dom';
import './Welcome.css';
import welcomeImage from './images/welcome2.png';

function Welcome() {
    return (
        <div className="welcome-container">
            <div className="left-half">
                <img src={welcomeImage} alt="Library Illustration" className="full-image"/>
            </div>
            <div className="right-half">
                <div className="overlay">
                    <h1 className="welcome-title">Welcome</h1>
                    <p className="welcome-text">
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit,
                        sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.
                    </p>
                    <div className="social-buttons">
                        <button className="social-button google">Sign in with Google</button>
                        <button className="social-button facebook">Sign in with Facebook</button>
                        <button className="social-button twitter">Sign in with Twitter</button>
                        <button className="social-button email">Sign up with email</button>
                    </div>
                    <div className="footer">
                        <p>No account? <Link to="/signup">Create account</Link></p>
                        <Link to="/terms" className="terms-link">Terms of service</Link>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Welcome;
